import React, { useEffect, useState } from 'react';
import './style.scss';
import Header from './components/Header/Header';
import Scooter from "./components/Scooter/Scooter";

function App() {
    const [bikes, setBikes] = useState([]); // создаём состояние для данных

    useEffect(() => {
        fetch('http://localhost:3000/bikes')
            .then(res => res.json())
            .then((data) => {
                setBikes(data); // сохраняем данные в состояние
            });
    }, []);

    return (
        <>
            <Header />
            <Scooter/>
        </>
    );
}

export default App;
